import React from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { searchUserByPhoneNumber } from '../store/slice/userReducer';

function Home() {

    const dispatch = useDispatch();
    const {searchUser} = useSelector(state => state.userReducer)
    function search(){
        let value = document.getElementById("search").value;
        dispatch(searchUserByPhoneNumber(value));
    }

    return (
        <div>
            <div className="sider">
                <div>
                    <input type="text" id='search' />
                    <button onClick={search} className='btn btn-warning'>search</button>
                </div>
                <div>
                    {
                        searchUser ? <div>
                        <h5>{searchUser.fullName}</h5>
                        <p>{searchUser.phoneNumber}</p>
                        <button>go to chat</button>
                    </div> : ""
                    }
                </div>
            </div>
        </div>
    );
}

export default Home;
